const BaseScreen = () => {

    const [ collapsed, setCollapsed ] = useState( true );


    const location = useLocation();

    return (
        <Layout>
            <FloatButton style={{width: 60, height: 60}} icon={<RiWhatsappFill size={40} color={'#25D366'}/>} href='https://wa.link/m219d3' target='_blank' />
            <Sider style={collapsed ? sideStyleCollapsed : sideStyle} width={collapsed ? 80 : 250} collapsible
                   collapsed={collapsed}
                   trigger={useMobileCheck() ? null :
                       <TriggerSidebarComponent collapsed={collapsed} setCollapsed={setCollapsed}/>}
                   breakpoint="lg"
                   onBreakpoint={( broken ) => {
                       setCollapsed( broken )
                   }}
                   className="background-sidebar">
                <SideBarComponent collapsed={collapsed}/>
            </Sider>
            <Layout style={{ marginLeft: collapsed ? 100 : 270, marginRight: 20 }}>
                <Header style={headerStyle}>
                    <NavBarComponent/>
                </Header>
                <Breadcrumb
                    style={breadcrumbStyle}
                    separator=">"
                    items={[ {
                        title: <NavLink to={location.pathname}>{getNameByPathname( location.pathname )}</NavLink>
                    } ]}
                />
                <Content style={contentStyle}>

                    <Routes>
                        <Route path="/" element={<Navigate to="/new-plants"/>}/>
                        <Route
                            path="*"
                            element={
                                <Navigate to="/new-plants"/>
                            }
                        />
                        <Route path='collection-plants'
                               element={<CollectorPlantsScreen plants={plants} user={userP}/>}/>
                        <Route path='carnivorous-plants'
                               element={<CarnivorousPlantsScreen plants={plants} user={userP}/>}/>
                        <Route path='wholesale-plants'
                               element={<WholesalePlantsScreen plants={plants} user={userP}/>}></Route>
                        <Route path='new-plants' element={<NewPlantsScreen plants={plants} user={userP}/>}></Route>
                        <Route path='other-products' element={<OtherProductsScreen/>}></Route>
                        <Route path="detail-product/:userType/:screen/:uid" element={<DetailProductScreen/>}></Route>
                    </Routes>
                </Content>
                <Footer style={{ textAlign: "center" }}>
                    <FooterComponentScreen/>
                </Footer>
            </Layout>
        </Layout>
    );
};

export default BaseScreen;
